import styled from 'styled-components'

const Nav = styled.nav`
    display: flex;
    border-style: solid;
    height: 3em;

    ul{
        list-style-type: none;
        display: flex;
        padding-left: 0;
        margin: 0;
        align-items: center;
    }

    li{
        display: flex;
        justify-content: center;
        align-items: center;
        cursor: pointer;
        width: 3.6em;
        padding: 0.3em;
        margin: 0.7em;
        height: 1em;
    }
`;

const Navbar = () => {
    return (
        <Nav>
            <ul>
                <li>Sizing</li>
                <li>On Hold</li>
                <li>Archive</li>
            </ul>
        </Nav>
    )
}

export default Navbar
